	(1668, 'https://ec.europa.eu/eurostat/documents/4187653/15353639/AnnaStills_shutterstock_2157593095_RV.jpg', 'In 2023, 1.1 million people acquired the citizenship of the EU country where they lived, an increase of around 6.1% (+60 200 people) compared with 2022. Most of the new citizenships were granted by Spain (240‚ÄØ200; 22.9% of the EU total), Italy (213‚ÄØ600; 20.3%) and Germany (199‚ÄØ800; 19.0%).  The majority (87.6%) of the people granted an EU citizenship were citizens of a non-EU country. Citizens of another EU country than the country of residence accounted for 10.7%.  This information comes from data on the acquisition of citizenship published by Eurostat today. This article presents just a handful of findings from the more detailed Statistics Explained article. Syrians, Moroccans and Albanians top 3 recipients In 2023, Syrian nationals were '),
