	(1670, 'https://ec.europa.eu/eurostat/documents/4187653/15353645/A_stockphoto_Shutterstock_702743290_RV.jpg', 'In 2022, 14.7% of employees in the EU were low-wage earners, against 16.2% in 2018. Low-wage earners are employees earning two-thirds or less of the median gross hourly earnings in the country of work. The share of low-wage earners was higher among women than men in 2022 (17.1% compared with 12.6%). In 2018 the shares were 18.2% of female and 12.5% of male employees.  Low-wage earners accounted for about a quarter (25.2%) of employees younger than 30. In the older age groups this share was lower: 12.1% among employees aged 30-49, and 13.4% among those older than 50.  Source datasets: earn_ses_pub1s, earn_ses_pub1a and earn_ses_pub1i The lower the level of a person‚Äôs education, the higher the likelihood of being a low-wage earner. In 2022, 2'),
