	(1671, 'https://ec.europa.eu/eurostat/documents/4187653/15566035/nito_AdobeStock_404841160_RV.jpg', 'In 2024, 70.0% of people aged 16-74 in the EU stated that they had used a website or an app of a public authority in the previous 12 months, a slight increase of 0.7 percentage points (pp) compared with 2023 (69.3%).  Among the EU countries, Denmark (98.5%), the Netherlands (96.0%) and Finland (95.4%) had the highest shares of e-government usage in 2024. By contrast, Romania (25.3%), Bulgaria (31.5%) and Italy (55.1%) had the lowest shares. Source dataset: isoc_ciegi_ac In 2024, the most common usage of e-government services in the past year was obtaining information about services, benefits, laws, opening hours, or similar topics (44.0%). This marks an increase of 2.4 pp from 2023.  Accessing personal information was the second most common'),
