	(763, 'https://ec.europa.eu/eurostat/documents/4187653/15727800/martin33_AdobeStock_66652891_RV.jpg', 'In the third quarter of 2024, the EU economy greenhouse gas emissions were estimated at 767 million tonnes of CO2-equivalents (CO2-eq), a 0.6% decrease compared with the same quarter of 2023 (772 million tonnes of CO2-eq). The EU‚Äôs gross domestic product (GDP) registered a 1.3% increase in the third quarter of 2024, compared with the same quarter of 2023.  This information comes from data on quarterly estimates for greenhouse gas emissions by economic activity published by Eurostat today. Quarterly estimates of greenhouse gas emissions complement quarterly socio-economic data, such as GDP or employment.  This article presents the key findings from the more detailed Statistics Explained article on quarterly greenhouse gas emissions. Source d'),
