	(550, 'https://ec.europa.eu/eurostat/documents/4187653/15521404/den-belitsky_AdobeStock_591801869_RV%20(1).jpg', 'In 2023, the EU railway network had 200 947 km of railway lines, with the highest densities being found  in and around main cities and other population hubs.  The highest railway network density was registered in Czechia, with 123.2 metres of railway lines per km¬≤. Other EU countries with high densities included Belgium (119.2 m/km¬≤), Germany (109.5 m/km¬≤) and Luxembourg (104.8 m/km¬≤). On the other end, the lowest railway network densities were found in Greece (14.0 m/km¬≤) and Finland (19.4 m/km¬≤). Low densities were also recorded in Sweden (26.8 m/km¬≤), Estonia (27.2 m/km¬≤), Portugal (27.8 m/km¬≤), Latvia (28.9 m/km¬≤) and Ireland (29.8 m/km¬≤). Source datasets: rail_if_line_tr,  reg_area3 and enpe_reg_area3 Expansion of high-speed railway li'),
