	(552, 'https://ec.europa.eu/eurostat/documents/4187653/15349467/Halfpoint_AdobeStock_423814082_RV.jpg', 'In 2023, 8.1% of people younger than 65 in the EU lived in households with very low work intensity. In these households, members of working age worked up to 20% of their total possible work hours over the previous year. The highest shares of people from 0-64 living in households with very low work intensity were recorded in 2 French outermost regions: Guyane (41.7%) and La R√©union (22.5%). These were followed by Bremen, Germany (21.8%), Prov. Hainaut, Belgium (21.5%), and Campania (21.2%) in Italy.  Source datasets: ilc_lvhl13n and ilc_lvhl21n By contrast, the lowest shares of people living in households with very low work intensity were recorded in Romanian region Bucure≈üti-Ilfov (0.7%), Austrian regions Salzburg (0.8%) and Tirol (1.1%), B'),
