	(2, 'https://ec.europa.eu/eurostat/documents/4187653/15586958/Atstock%20Productions_shutterstock_557307181_RV.jpg', 'In 2023, EU countries exported ‚Ç¨1 427 billion worth of services to countries outside of the EU (+2% compared with 2022). Imports from countries outside the EU stood at ‚Ç¨1 274 billion (+4% compared with 2022). This marks a continuing upward trend following a disruption in 2020 due to the impact of the COVID-19 pandemic.   In 2023, the EU trade in services balance reached ‚Ç¨153 billion, the second highest figure since 2010, after the record ‚Ç¨181 billion in 2022. This information comes from data on EU trade in services published by Eurostat today.  Source dataset: bop_its6_det Leading trade partners in 2023: USA and UK EU‚Äôs leading trade partners for international exports of services were the United States (‚Ç¨319 billion; 22% of extra-EU exports'),
	(12, 'https://ec.europa.eu/eurostat/documents/2995521/18500187/Ivan%20Marc_shutterstock_1308160366_RV.jpg', 'Overview In the fourth quarter of 2024, seasonally adjusted GDP remained stable in the euro area and increased by 0.1% in the EU, compared with the previous quarter, according to a preliminary flash estimate published by Eurostat, the statistical office of the European Union. In the third quarter of 2024, GDP had grown by 0.4% in both areas. According to a first estimation of annual growth for 2024, based on seasonally and calendar adjusted quarterly data, GDP increased by 0.7% in the euro area and by 0.8% in the EU. These preliminary GDP flash estimates are based on data sources that are incomplete and subject to further revisions. Compared with the same quarter of the previous year, seasonally adjusted GDP increased by 0.9% in the euro ar'),
	(13, 'https://ec.europa.eu/eurostat/documents/2995521/18612388/fizkes_shutterstock_1044298738_RV.jpg', 'Overview In December 2024, the euro area seasonally-adjusted unemployment rate was 6.3%, up from 6.2% in November 2024 and down from 6.5% in December 2023. The EU unemployment rate was 5.9% in December 2024, up from 5.8% in November 2024 and down from 6.0% in December 2023. These figures are published by Eurostat, the statistical office of the European Union. Eurostat estimates that 12.978 million persons in the EU, of whom 10.830 million in the euro area, were unemployed in December 2024. Compared with November 2024, unemployment increased by 94 thousand in the EU and by 96 thousand in the euro area. Compared with December 2023, unemployment decreased by 261 thousand in the EU and by 266 thousand in the euro area. Youth unemployment In Dec'),
	(194, 'https://www.ema.europa.eu/sites/default/files/styles/ema_smp_opengraph/public/2025-01/2025-01_azoles%20fungicides_WEB.png.webp?itok=DpumVrRH', 'The extensive use of azole fungicides (azoles), particularly in some agricultural and horticultural practices, can increase the risk of Aspergillus fungi developing resistance to essential antifungal treatments. This significant finding is highlighted in a report by the five EU health and environment agencies, with support from the European Commission‚Äôs Joint Research Centre (JRC). The Agencies collaborated under a One Health approach to address this growing threat.'),
