	(6, 'https://ec.europa.eu/eurostat/documents/4187653/15849490/SvedOliver_Shutterstock_117781990_RV.jpg', 'In 2023, the average price of 1 hectare of arable land in the EU was ‚Ç¨11 791, while the average annual rental price of arable land and or permanent grassland stood at ‚Ç¨173 per hectare.  This information comes from data on agricultural land prices and rents published by Eurostat today. Arable land prices highest in Malta Among the 22 EU countries with available data, by far the highest average price for 1 hectare of arable land was recorded in Malta, at ‚Ç¨283 039 per hectare. The next highest average price was in the Netherlands at ‚Ç¨91 154 per hectare, and then in Luxembourg at ‚Ç¨42 540 per hectare.  By contrast, the lowest average prices were recorded in Croatia (‚Ç¨4 491 per hectare), Latvia (‚Ç¨4 591) and Slovakia (‚Ç¨5 189). Source dataset: apri'),
	(7, 'https://ec.europa.eu/eurostat/documents/4187653/16084343/alpegor_AdobeStock_582308306_RV%20(1).jpg', 'In 2023, the number of vessels handling freight or embarking and disembarking passengers in the main EU ports was estimated to be 2.2 million, an increase of 1.5% from the previous year.  Greece had the highest number of port calls with 477 115 vessels, followed by Italy (449 131 vessels) and Denmark (322 230 vessels). At the other end of the scale, Slovenia (1 760 vessels), Cyprus (2 090 vessels) and Bulgaria (2 851 vessels) reported the lowest numbers. Compared with 2013, 12 out of the 22 reporting EU countries registered increases in the number of vessels calling at ports. The largest increases were observed in Malta (+100.8%), Croatia (+40.3%) and Spain (+31.0%). By contrast, the biggest decline was reported in Finland (-26.6%), Latvia '),
	(14, 'https://ec.europa.eu/eurostat/documents/2995521/18500163/Drazen_AdobeStock_523075875_RV.jpg', 'Overview In the third quarter of 2024, household real consumption per capita increased by 0.8% in the euro area, after an increase of 0.1% in the previous quarter. Household real income per capita increased in the third quarter of 2024 by 0.4%, after an increase of 0.3% in the second quarter of 2024. These data come from a detailed set of seasonally adjusted quarterly European sector accounts that is published by Eurostat, the statistical office of the European Union. In the EU, household real consumption per capita increased by 0.8% in the third quarter of 2024, after an increase of 0.1% in the previous quarter. At the same time, household real income per capita increased by 0.6% in the third quarter of 2024, after an increase of 0.5% in t'),
