	(10, 'https://ec.europa.eu/eurostat/documents/4187653/15590792/luckybusiness_AdobeStock_188818511_RV.jpg', 'In 2022, there were more than 1.4 million healthcare professionals in the EU working as dentists, physiotherapists or pharmacists. Among the 26 countries for which data are available, there were 363 162 dentists in 2022. The country with the highest share of practising dentists by population was Cyprus (with 119.4 dentists per 100 000 inhabitants), while Greece (with 133.2 dentists per 100 000 inhabitants), and Portugal (120.6 dentists per 100 000 inhabitants) reported higher shares of dentists licensed to practice.  At the other end of the scale, Ireland had the fewest dentists per 100 000 inhabitants with 45.1, followed by Malta with 50.8 and Slovakia with 54.7.  Source dataset: hlth_rs_prs2 Physiotherapists are key to helping patients re'),
	(11, 'https://ec.europa.eu/eurostat/documents/4187653/16724912/Koldunov_Shutterstock_2237206631_RV.jpg', 'In 2023, 10.6% of the EU population were not able to keep their home adequately warm. Compared with 2022, this share increased by 1.3 percentage points (pp). The highest shares of people unable to keep their homes adequately warm were observed in Spain and Portugal (both 20.8%), followed by Bulgaria (20.7%), Lithuania (20.0%) and Greece (19.2%). By contrast, Luxembourg (2.1%), Finland (2.6%), Slovenia (3.6%), Austria (3.9%) and Estonia (4.1%) reported the lowest shares.   Source dataset: ilc_mdes01  '),
