	(18, 'https://ec.europa.eu/eurostat/documents/2995521/18612440/SeventyFour_AdobeStock_282123716_RV.jpg', 'Overview The euro area annual inflation rate was 2.4% in December 2024, up from 2.2% in November. A year earlier, the rate was 2.9%. European Union annual inflation was 2.7% in December 2024, up from 2.5% in November. A year earlier, the rate was 3.4%. These figures are published by Eurostat, the statistical office of the European Union. The lowest annual rates were registered in Ireland (1.0%), Italy (1.4%), Luxembourg, Finland and Sweden (all 1.6%). The highest annual rates were recorded in Romania (5.5%), Hungary (4.8%) and Croatia (4.5%). Compared with November 2024, annual inflation fell in seven Member States, remained stable in one and rose in nineteen. In December 2024, the highest contribution to the annual euro area inflation rate'),
	(328, 'https://static.dw.com/image/71315135_6.jpg', 'A dozen former German gymnasts have opened up about their mistreatment in the sport and are calling for change. Two of them spoke to DW.'),
	(329, 'https://static.dw.com/image/68880435_6.jpg', 'Romania is repeating elections after allegations of political interference by Russia via TikTok. Elon Musk has used X to promote German far-right party AfD. Scientists want to know whether any of this affects voters.'),
	(190, 'https://www.europarl.europa.eu/news/img/meta-facebook.jpg', 'Spokespersons for Parliament and for the political groups will hold a briefing on the 20 - 23 January plenary session on Friday at 11.00, in Parliament‚Äôs Anna Politkovskaya press room.'),
	(201, 'https://www.ema.europa.eu/sites/default/files/styles/ema_smp_opengraph/public/2025-01/2025-01_Human-Medicines-in-2024_WEB_Slider.png.webp?itok=zgfR_2ib', '114 new medicines recommended for approval; 46 had a new active substance'),
	(330, 'https://static.dw.com/image/71134475_6.jpg', 'For the first time in history, a pope\'s autobiography has been published in his lifetime. The book is both a manifesto and a testament.'),
