	(332, 'https://static.dw.com/image/71224395_6.jpg', 'Advocates are pushing for controversial nuclear energy to play a greater role in global plans to mitigate climate change. Is that likely?'),
	(333, 'https://static.dw.com/image/71282335_6.jpg', 'Hollywood actors and film crews have lost their homes as flames continue to engulf the Los Angeles region. Yet many film and TV productions are back to work after a brief pause.  '),
	(131, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/sirious-logo-building-pattern.jpg?itok=acyM20nx', 'Building on six years of successful support to national law enforcement agencies (LEAs) and judicial authorities (JAs) in the field of electronic evidence, Europol and Eurojust launched the third phase of the SIRIUS project in January 2025.¬†'),
	(20, 'https://ec.europa.eu/eurostat/documents/2995521/18612523/SasinTipchai_shutterstock_146957396_RV%20(1).jpg', 'Overview In November 2024, compared with October 2024, seasonally adjusted industrial production increased by 0.2% in the euro area and by 0.1% the EU, according to first estimates from Eurostat, the statistical office of the European Union. In October 2024, industrial production grew by 0.2% in the euro area and by 0.4% in the EU. In November 2024, compared with November 2023, industrial production decreased by 1.9% the euro area and by 1.7% in the EU. Monthly comparison by main industrial grouping and by Member State In the euro area in November 2024, compared with October 2024, industrial production increased by 0.5% for intermediate goods, increased by 1.1% for energy, increased by 0.5% for capital goods, increased by 1.5% for durable c'),
	(334, 'https://static.dw.com/image/70935343_6.jpg', 'VW produces and sells vehicles worldwide. Its Germanness is an important selling point, but the company is equally at home in China, Brazil and the US. Its dependence on foreign markets may soon come to bite.'),
	(64, NULL, NULL),
	(335, 'https://static.dw.com/image/64121540_6.jpg', 'Testing new antibiotics in India, South Africa or Brazil, where they are needed most, makes scientific sense. But it‚Äôs not without challenges. If the drugs lack global viability, they are less likely to get used.'),
	(336, 'https://static.dw.com/image/71296399_6.jpg', 'Former Liverpool and Borussia Dortmund coach J√ºrgen Klopp is now head of global soccer for soft drink firm Red Bull. To many, the move is controversial.'),
