	(340, 'https://static.dw.com/image/70138402_6.jpg', 'The Pacific Palisades fire has burned down the inventory of the exclusive publisher of the works of musical pioneer Arnold Schoenberg, inventor of the 12-tone technique.'),
	(341, 'https://static.dw.com/image/70603534_6.jpg', 'Experts say new US sanctions on oil exports could have a serious impact on Russia\'s revenues and lead India and China to seek alternative supplies.'),
	(342, 'https://static.dw.com/image/71113207_6.jpg', 'Backlash against diversity, equity and inclusion policy is surging in the US, and major companies are scaling back their efforts. Trump\'s second presidency is likely to intensify this trend. So why are experts hopeful?'),
	(132, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-polish-presidency-logo.png?itok=bK4Y5T2K', 'In the field of justice and security, the Polish Presidency of the Council of the European Union will focus on combatting major cross-border criminal networks, hybrid threats, and terrorism and radicalisation. Particular attention will be paid to combat the trafficking of illicit drugs, human trafficking and migrant smuggling.¬†Another priority is the protection of minors from exploitation, including sexual abuse. Efforts to ensure accountability for alleged core international crimes committed in Ukraine will also be a major focus. Poland took up the Presidency on 1 January.¬†'),
	(21, 'https://ec.europa.eu/eurostat/documents/2995521/18500160/fizkes_AdobeStock_520355852_RV.jpg', 'Overview The household saving rate in the euro area was at 15.3% in the third quarter of 2024 (compared with 15.6% in the second quarter of 2024), which is explained by consumption increasing by 1.1%, at a faster rate than gross disposable income (+0.7%). These data come from a first release of seasonally adjusted quarterly European sector accounts from Eurostat, the statistical office of the European Union. At the same time, the household investment rate in the euro area decreased from 9.2% to 9.1% in the third quarter of 2024, as gross fixed capital formation decreased by 0.2%, while gross disposable income increased by 0.7%. In the third quarter of 2024, the profit share of businesses (non-financial corporations) slightly increased from '),
	(22, 'https://ec.europa.eu/eurostat/documents/2995521/18500190/Marian%20Weyo_Shutterstock_1358194877_RV.jpg', 'Overview In the third quarter of 2024, the EU seasonally adjusted current account of the balance of payments recorded a surplus of ‚Ç¨106.0 billion (+2.4% of GDP), compared with a surplus of ‚Ç¨136.2 billion (+3.1% of GDP) in the second quarter of 2024 and a surplus of ‚Ç¨99.4 billion (+2.3% of GDP) in the third quarter of 2023, according to estimates released by Eurostat, the statistical office of the European Union. EU current and capital accounts In the third quarter of 2024 compared with the second quarter of 2024, based on seasonally adjusted data the surplus of the goods account decreased (+‚Ç¨86.2 bn compared to +‚Ç¨99.9 bn), the surplus of the services account decreased (+‚Ç¨35.7 bn compared to +‚Ç¨54.8 bn), the surplus of the primary income acco'),
	(343, 'https://static.dw.com/image/69319225_6.jpg', 'As the 2025 season begins with the Australian Open, the head of German tennis tells DW of the ambitious goals for the year ahead.'),
	(344, 'https://static.dw.com/image/71267659_6.jpg', 'Donald Trump\'s desire to control Greenland has thrust the island‚Äôs independence into the spotlight. The battle for Greenland\'s football team to be recognized on the world stage matters, but the landscape is complex.'),
	(345, 'https://static.dw.com/image/71250484_6.jpg', 'The specter of flames devouring built environments has become more familiar over recent years and is often blamed on rising global temperatures. But is that always the case?'),
	(203, 'https://www.ema.europa.eu/sites/default/files/styles/ema_smp_opengraph/public/2025-01/2025-01_health%20technology%20assessment_WEB.png.webp?itok=wKW2Gmi6', 'Enhanced EU collaboration to allow faster and wider access to innovative health technologies'),
	(346, 'https://static.dw.com/image/71275641_6.jpg', 'The devastating wildfires which have hit Los Angeles and other parts of southern California could be one of the costliest natural disasters in US history. They\'re also wreaking havoc for already struggling home insurers.'),
	(347, 'https://static.dw.com/image/60791612_6.jpg', 'In his lawsuit, actor Alec Baldwin has alleged that the prosecutors intentionally mishandled evidence. It follows the legal controversy surrounding his involvement in Halyna Hutchins\' death on the set of "Rust."'),
	(348, 'https://static.dw.com/image/68772794_6.jpg', 'Last month was the hottest January on record, with temperatures 1.75 Celsius above pre-industrial era levels. This comes despite expectations that an emerging La Nina weather pattern could cool global temperatures. '),
	(349, 'https://static.dw.com/image/71254711_6.jpg', 'As wildfires rip through the Los Angeles area, the Thomas Mann House and Villa Aurora, historic places of exile that now serve as cultural centers, have already been partially damaged and continue to remain under threat.'),
	(65, NULL, NULL),
	(66, NULL, NULL),
	(350, 'https://static.dw.com/image/71252763_6.jpg', 'Los Angeles is the latest in a number of cities around the world forced to battle flames. As climate change intensifies wildfires, how can urban areas better prepare themselves? '),
	(351, 'https://static.dw.com/image/69772253_6.jpg', 'As massive wildfires rage in Los Angeles, DW looks at how strategic burning and adaptive planting can help protect the planet\'s forests.'),
	(352, 'https://static.dw.com/image/67153800_6.jpg', 'A collection of reviews in the journal Neuron reflects on progress in understanding the impact of aging on the brain, but many questions remain unanswered.'),
	(353, 'https://static.dw.com/image/57734851_6.jpg', 'Countries around the world are working to reduce their emissions of planet-heating carbon dioxide. Germany is now responsible for less than 2%, but even that is too much.'),
	(354, 'https://static.dw.com/image/62812327_6.jpg', 'On what would have been his 90th birthday, the legendary singer will be celebrated over a four-day event in Memphis. Here are some highlights from his storied career.'),
	(67, NULL, NULL),
	(355, 'https://static.dw.com/image/71111450_6.jpg', 'A person hospitalized with H5N1 bird flu has died, marking the first fatality linked to the currently circulating infection in the US. Human-to-human spread has not been detected, so what\'s the real risk?'),
	(133, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/20250107-wasik-pawel-nm-poland-infocus.jpg?itok=i5SwowiU', 'Mr Pawe≈Ç WƒÖsik took up his duties as the new National Member for Poland at Eurojust this week. He replaces Mr Marius Skowronski and will serve a term of four years. Mr WƒÖsik (48) is an experienced public prosecutor who has been posted at the Agency since 2016 as Assistant to the National Member for Poland. He currently heads the Economic Crime Team at Eurojust.'),
	(356, 'https://static.dw.com/image/71229750_6.jpg', 'French satirical magazine Charlie Hebdo is marking 10 years since the terror attacks on its Paris office by running a cartoon contest asking for God-mocking submissions.  '),
	(357, 'https://static.dw.com/image/71232883_6.jpg', 'An outbreak of human metapneumovirus in China has raised concerns of another widespread respiratory illness. HMPV has likely been around for centuries, and it has likely infected most people once in their lifetime.'),
	(358, 'https://static.dw.com/image/71226148_6.jpg', 'Hollywood\'s award season kicked off with the 82nd Golden Globe Awards. "Emilia P√©rez" and "The Brutalist" won big. Surprises included wins for actresses Fernanda Torres and Demi Moore.'),
	(359, 'https://static.dw.com/image/67917549_6.jpg', 'Cologne Cathedral houses the Shrine of the Three Kings, a reliquary that tradition says holds the bones of the Biblical Magi. But how did they get there?'),
	(360, 'https://static.dw.com/image/71211590_6.jpg', 'The birth of Hilda, a calf in Scotland bred to produce less methane, is being hailed as a significant breakthrough for greening the industry. How far could its climate impact go?'),
	(134, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/us-liaison-prosecutor-ms-martyna-pospieszalska-eurojust.jpg?itok=Yv7lSZTY', 'Ms Martyna Pospieszalska has taken up her duties as the new Liaison Prosecutor for the United States at Eurojust. She succeeds Mr Philip Mirrer-Singer and has been appointed for an initial term of two years. Ms Pospieszalska has over a decade of experience working in the field of international cooperation in criminal matters with extensive expertise in extraditions, mutual legal assistance, electronic evidence and cross-border asset forfeiture.'),
	(1872, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2023/07/11/Power-play-social.png', 'Will Ukrainian President Volodymyr Zelenskyy‚Äôs olive branch to Donald Trump be enough to secure Ukraine‚Äôs future ‚Äî and his own? After his bruising encounter with the U.S. president in the Oval Offi‚Ä¶'),
	(1873, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2025/03/05/GettyImages-2202533198-scaled.jpg', 'The bloc will miss a self-imposed deadline to unveil its plan to end reliance on Moscow.'),
	(135, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/institutional-year-in-review.jpg?itok=1Xm2SAx6', 'Eurojust is the EU‚Äôs powerhouse for international judicial cooperation, setting the global standard for how to tackle cross-border crime effectively and efficiently.This year saw the further evolution of the Agency, as we expanded our cooperation with partner countries, continued our support of accountability efforts in Ukraine, and welcomed new leadership ‚Äì among other milestones.'),
	(136, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/casework-highlights-24.png?itok=Np_1QqKy', 'As the hub for cross-border judicial cooperation, Eurojust works together with national authorities to fight organised crime. Our support and expertise helps authorities to solve complex investigations into a variety of crime types. In 2024, we saw a number of long running cases lead to joint operations that arrested suspects, seized goods and stopped criminals in their tracks.'),
	(68, NULL, NULL),
	(69, NULL, NULL),
	(137, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-de-bg-cable-case.png?itok=R8pwZpgB', 'German and Bulgarian authorities have rolled up a criminal group that was involved in the large-scale theft of power cables across Germany. The disappearance of the cables caused major disruptions to large public construction sites. During a joint operation coordinated by Eurojust and Europol, eight suspects were arrested.'),
	(138, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/euromed-20th-crimex-in-the-hague.jpg?itok=eaZWdx-M', 'Under the framework of the 6th phase of the EuroMed Justice (EMJ) project, the 20th CrimEx was held on 11 and 12 December in a hybrid format at the Eurojust premises in The Hague. Criminal justice representatives from 7 South Partner Countries (SPCs) and 10 European Union Member States (EU MS) gathered to discuss technical and strategic aspects of international judicial cooperation in criminal matters along with the missions, goals and next steps of the cooperation mechanisms of the EuroMed Justice project.'),
	(139, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/etruscan-art-robbery.png?itok=YzP42GOD', 'Italian authorities have disrupted a sophisticated operation that was illegally exporting precious archaeological artefacts belonging to the Italian state. The criminal group worked with expert grave robbers and thieves to excavate numerous objects. Following a complex investigation lasting over several years, Italian authorities, supported by Eurojust, dismantled the organisation and arrested four suspects.'),
	(140, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/albania-kosovo-case.png?itok=YMPPFM3a', 'Authorities from Albania and Kosovo, supported by Eurojust and Europol, have disrupted an arms trafficking gang operating in both countries. The suspects were responsible for the supply, transport and sale of weapons and explosive materials, setting up an intricate import and export route towards the European Union. During a joint operation on 10 and 11 December, 14 suspects were arrested in Albania and Kosovo.'),
	(141, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/cash-brazil-italy-case.png?itok=V76xzvo-', 'A joint operation in Brazil and Italy has led to the arrest of 23 members of a cocaine trafficking network linked to mafia families in Italy. The three criminal groups running the drug smuggling operation used cargo ships and private aircraft to transport large quantities of cocaine to Europe. Eurojust and Europol supported the investigations and the action day on 10 December.'),
	(142, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/delamata-web.jpg?itok=57650lNc', 'National Member for Spain Mr Jos√© de la Mata Amaya was elected Vice-President of Eurojust today. Mr de la Mata (62) will serve a four-year mandate and work closely with the recently elected new Eurojust President Mr Michael Schmid and fellow Vice-President Ms Margarita ≈†niutytƒó-Daugƒólienƒó, to represent the Agency and oversee its management. The new Vice-President of Eurojust will take up his duties on 18 December.'),
	(143, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/wbcj-project-winter-academy-on-judicial-cooperation-1.jpg?itok=w1rppkon', 'The Western Balkans Criminal Justice Project (WBCJ), in collaboration with the Academy of European Law (ERA), the JITs Network, and the Sirius Project, successfully organised the Winter Academy on Judicial Cooperation in Cross-Border Organized Crime for newly appointed Western Balkan practitioners from December 4 to 6, 2024, in Trier, Germany. This intensive three-day training provided a valuable platform for Western Balkan judicial practitioners to deepen their understanding and skills in cross-border judicial cooperation.'),
	(144, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-phone-phishing-case-bl-nl.png?itok=47_ivQ-_', 'In a concerted operation, Belgian and Dutch authorities have cracked down on an internationally operating ‚Äòphone phishing‚Äô gang, leading to the arrest of eight suspects. In addition to ‚Äòphishing‚Äô, or trying to gain access to bank or financial data by phone or online, the suspects also visited mainly elderly victims at their homes, pretending to be bank employees or police officers. Eurojust and Europol coordinated and supported the actions in Belgium and the Netherlands, where 17 places were also searched.'),
	(145, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/boats-seizures.jpg?itok=a77gBsvm', 'French and German authorities, supported by Eurojust and Europol, have rolled up a criminal network responsible for transporting equipment used to smuggle migrants to the United Kingdom. An international operation took place on 4 December where five suspects were arrested in France and eight suspects were arrested in Germany.'),
	(146, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-de-sr-drugs-case.jpg?itok=gzXJHVPN', 'With support from Eurojust, the German and Serbian authorities have taken down a drug trafficking network operating from the Rhine-Main area of Germany. Today, in a coordinated action, ten suspects were arrested and around thirty places searched in connection to the smuggling and distribution of tens of kilos of mainly cocaine throughout different European countries. Eurojust supported the German and Serbian authorities with setting up and financing a joint investigation team (JIT) into the organised crime group (OCG).¬†'),
	(147, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/matrix-social-post-landscape-v4.png?itok=WgXxUOke', 'Authorities are staying on top of the encrypted messaging services that criminals use to undertake their activities. A joint investigation team (JIT) involving French and Dutch authorities has taken down another sophisticated encrypted messaging service, MATRIX. For three months, authorities were able to monitor the messages from possible criminals, which will now be used to support other investigations. During a coordinated operation supported by Eurojust and Europol, the messaging service was taken down by Dutch and French authorities and follow-up actions were executed by their Lithuanian and Spanish counterparts.'),
	(148, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/sirius-e-evidence-situation-report-2024-small.png?itok=kQ6PcWlg', 'SIRIUS EU Electronic Evidence Situation Report 2024Read the reportEurojust, Europol and the European Judicial Network have published the 2024 edition of the SIRIUS European Union (EU) Electronic Evidence Situation Report.¬†First presented at the SIRIUS Annual Conference to an audience of EU law enforcement and judicial authorities, policymakers, and representatives of service providers, the report reflects on the evolving legislative framework and the growing reliance on electronic data in criminal investigations, while highlighting the persistent barriers to effective cooperation in accessing electronic data across borders for investigation and prosecution of crimes.'),
	(149, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/20241125-counter-terrorism-meeting-1.jpg?itok=A8etdMm9', 'On 27 and 28 November, Eurojust hosted its annual counter-terrorism meeting, which gathered specialised prosecutors and other experts from EU Member States and third countries, as well as representatives from EU institutions, to discuss the latest challenges and share best practices in combatting terrorist threats.'),
	(150, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-illegal-streaming-case.jpg?itok=4DDAm1jK', 'Authorities have struck a blow at illegal streaming networks, by shutting down one of the world‚Äôs largest illegal service. Eurojust and Europol supported the operation, which involved cooperation between Italian, Croatian, Dutch, Romanian, Swedish, Swiss and UK authorities. In a large-scale operation, over 100 searches were carried out against 102 suspects. Eleven suspects are arrested in Croatia.'),
	(71, NULL, 'EUSPA Open Days 2024 are on. The two-day event is organised so the public can learn more about our agency and what we do in #EUSpace! This year‚Äôs edition will feature several captivating activities, such as interactive Augmented Reality experiences, cryptography games and a treasure hunt. Throughout the event, our team of experts will inform visitors from the public, showcasing the many ways in which EU Space impacts our daily lives.'),
	(151, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/eighth-annual-meeting-on-migrant-smuggling.jpg?itok=ipeH26y2', 'From November 20-21, Eurojust hosted its eighth annual meeting on migrant smuggling. The meeting, organised by Eurojust‚Äôs Anti-Trafficking Team, brought practitioners together to discuss the latest operational and strategic developments in the field of combatting migrant smuggling.'),
	(152, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/generic-image.png?itok=owLbgorE', 'Eurojust and Europol have assisted the German authorities with the coordinated takedown of a smuggling network, which was illegally transporting Syrian migrants via the Balkan route. In total, 29 suspects involved in the smuggling of at least 750 migrants to Germany and the United Kingdom were arrested. Twenty arrests were made yesterday during a coordinated action. Last month, the Serbian authorities already arrested and charged nine suspects involved in the same organised crime group (OCG).Eurojust also supported Germany, Poland, Bosnia and Herzegovina, and Serbia in setting up and financing a joint investigation team (JIT), in operational partnership with Austria, to investigate the criminal network.'),
	(153, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/cigarettes.jpg?itok=dlGQMi-_', 'Eurojust, Europol and authorities from 10 countries stopped a criminal group operating an intricate cigarette trafficking scheme. The authorities discovered a Polish group active in cigarette trafficking and investigations connected a counterfeit cigarette factory in France to another international criminal group involved in the operation. Fifteen suspects were arrested on Tuesday morning in a joint operation involving five countries.'),
	(154, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/precious-archaeological-vases-in-focus.jpg?itok=7sOFiUOB', 'Eurojust has supported Italian authorities with the return of over 2 500 precious ancient coins, vases and small sculptures that had been illegally excavated and later sold in Switzerland. Last Friday afternoon, the treasures from the ancient city of Cales, dating from the third century BC and the eight century DC, were officially presented in the National Archaeological Museum of Santa Maria Capua Vetere.'),
	(155, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-al-it-cocaine-case.jpg?itok=FjTFcGx4', 'Albanian authorities arrested ten alleged members of a drug trafficking network over the weekend in an operation supported by Eurojust. A sophisticated cocaine-processing laboratory was also seized in Albania. The members of the Albanian organised crime group (OCG) were involved in the transport of cocaine from Latin America via Italy to Albania, from where it was trafficked to several European countries.'),
	(156, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-hu-ro-thb-case.png?itok=aP4sYN2r', 'Eight suspects have been arrested during a Eurojust supported operation against a human trafficking ring in Hungary and Romania. The criminals recruited people from Romania and forced them to work in poor conditions and without freedom of movement in a paper factory in Hungary.'),
	(157, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-be-uk-nl-small-boats.png?itok=BIgyRQjW', 'During an international action, a major supplier of small boats to human smugglers was arrested in the Netherlands. Dutch, Belgian and UK authorities worked together with Eurojust and Europol to arrest the individual who is suspected of supplying engines and boats to smugglers.'),
	(158, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-image.png?itok=wTpKUEFD', 'The 36th Meeting of the Genocide Network took place this week at Eurojust. More than 140 experts gathered at Eurojust headquarters to discuss the critical issue of unlawful attacks against civilians under international humanitarian law.'),
	(159, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/20241111-nmat-schmid-3-web.jpg?itok=00Axw9tg', 'Mr Michael Schmid, National Member for Austria at Eurojust, has today been elected as the new President of the Agency. He will take up office on 15 November for a four-year term, replacing the current President, Mr Ladislav Hamran, who is completing his second and final term. Mr Schmid (40) has represented the Austrian judicial authorities at Eurojust as National Member since 2022. Previously, he was Deputy National Member at the Agency and Justice Counsellor at the Permanent Representation of Austria at the European Union in Brussels.'),
	(160, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/fake-art-case-1.png?itok=pCbxYuPz', 'Thirty-eight people have been indicted following an unprecedented operation supported by Eurojust against a criminal network for forging over 2 000 works of contemporary art. A year-and-a-half-long investigation by Italian authorities, in cooperation with Belgian, French and Spanish counterparts, led to the dismantling of the network, which would have caused economic damage of EUR 200 million.'),
	(161, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/ej-buiding-default.jpg?itok=RstpGkne', 'This week, Eurojust hosted two hybrid meetings on surrender and extradition procedures, organized in cooperation with partners from the United Kingdom and United States, respectively.'),
	(162, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/sirius-conference-2024.jpg?itok=3bELdE39', 'The SIRIUS Conference 2024 took place from 5-7 November, bringing together law enforcement, judicial authorities, policy makers, and service providers to discuss the evolving challenges in cross-border access to electronic evidence. This annual event serves as a platform for updates on legal developments, data disclosure procedures, and the latest investigative tools, with hands-on training from industry experts.'),
	(163, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-de-cy-investment-fraud.png?itok=N19svIFX', 'German and Cypriot authorities have launched a coordinated operation to block 13 fake investment platforms, with support from Eurojust and Europol. During a joint action day in Cyprus and Germany, four suspects were arrested for defrauding victims of millions of euros and for money laundering. The fraud was run from a call centre based in Cyprus and robbed victims of at least EUR 10 million.'),
	(164, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/2024-11-05-drug-case.png?itok=_z4ygwer', 'An international operation coordinated by Eurojust and Europol has disrupted the trafficking of large quantities of cocaine from South America to various Italian seaports. In total, 29 suspects belonging to an Albanian-led criminal network were arrested in Italy and Albania. Simultaneously, locations were searched in France, Romania, and Spain were searched to gather information and potential evidence. The successful crackdown is the result of a long-term joint investigation teams (JITs), supported and financed by Eurojust.'),
	(165, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/emj-event-lady-justice.png?itok=wlSFA6gy', 'On 29-30 October, the 4th EuroMed Justice Network (EMJNet) meeting was held at the Ministry of Justice of Spain in Madrid.'),
	(166, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/redline-meta.png?itok=sNT-FEZt', 'A global operation, supported by Eurojust, has led to the takedown of servers of infostealers, a type of malware used to steal personal data and conduct cybercrimes worldwide. The infostealers, RedLine and META, taken down today targeted millions of victims worldwide, making it one of the largest malware platforms globally. An international coalition of authorities from the Netherlands, the United States, Belgium, Portugal, the United Kingdom and Australia shut down three servers in the Netherlands, seized two domains, unsealed charges in the United States and took two people into custody in Belgium.'),
	(167, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-narco-boats-case-pt-es.png?itok=xDZ2Oa7J', 'Spanish and Portuguese authorities have rolled up of a sophisticated drug trafficking network operating in both countries. The criminal group manufactured illegal boats that were used to transport large quantities of drugs into Spain. The group was also involved in drug trafficking. An international investigation coordinated by Eurojust resulted in the arrest of 28 suspects and the seizure of 23 kilos of heroin.'),
	(168, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/0-default-logoeurojust.png?itok=VvBb__Mk', 'The series of outreach events organised by the Western Balkans Criminal Justice (WBCJ) Project has successfully concluded, covering Albania, Bosnia and Herzegovina, Kosovo*, Montenegro, North Macedonia, and Serbia. The Project Team held six events in the region between September 2023 and October 2024, one in each beneficiary country, with a focus on promoting Eurojust, the WBCJ Project, the EJN Network, the JITs Network, and the range of support available to the region.'),
	(169, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-de-cybercrime.png?itok=EOj2YqvT', 'A large-scale online investment scam has been dismantled with support of Eurojust. The perpetrators allegedly ran a fraud scheme that used fake investment platforms to deprive victims of at least EUR 300 million. At the request of the German authorities in Saxony, yesterday one suspect was arrested in Cyprus in a coordinated action. Eurojust assisted the German and Serbian authorities in setting up a joint investigation team (JIT) into the case.'),
	(170, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/20241023-jits-annual-meeting-12.jpg?itok=jzCnddr8', 'On 23-24 October, the 20th Annual Meeting of the National Experts on Joint Investigation Teams took place at Eurojust. This year‚Äôs event focused on the admissibility of evidence and e-evidence, a crucial aspect of modern criminal investigations. It was organised by the JITs Network Secretariat, in collaboration with Eurojust and Europol.'),
	(171, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-infocus-pills-pictures.jpg?itok=ncSHGthS', 'A criminal group that had set up an international smuggling route for prescription pills was taken down during a large-scale operation coordinated from Eurojust‚Äôs headquarters. Romanian, Estonian, Finnish and Serbian authorities, supported by Eurojust and Europol, arrested 47 people and seized over 6 million pills.'),
	(172, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/20241017-conforum-familyphoto-sm.jpg?itok=6gjOfc3X', 'The protection of intellectual property rights and stepping up the fight against major organised criminal networks, including the better execution of penalties, were at the forefront of the annual meeting of European Prosecutors General, taking place yesterday and today. During their 18th annual Forum, hosted at Eurojust, they discussed how to increase cooperation and the exchange of best practice.Only last month, Eurojust launched the new European Judicial Organised Crime Network (EJOCN). The establishment of the EJOCN was one of the priorities of the Belgian Presidency of the Council of the European Union (EU) during the first half of 2024. Taking on the stark increase of infringements on intellectual property rights and related crimes in'),
	(173, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/fr-it-ep-wine-case.png?itok=djg0aFP8', 'Eurojust and Europol supported the investigation by French and Italian authorities that led to the arrest of seven suspects and the seizure of cash, valuable goods and documentation needed for the investigation.'),
	(174, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-case-de-hr-cz-it.png?itok=7qAXeRZL', 'Eurojust supported authorities in Germany, Croatia, Czechia and Italy to counter a long-term fraud with illegal or undeclared labour and tax evasion. During an action day, five suspects were arrested for allegedly running a network of building enterprises that employed labourers without paying taxes and social levies. In total, 47 places were searched in the four countries concerned.'),
	(72, NULL, 'Today, the EU Agency for the Space Programme (EUSPA), together with the European Commission, launched the CASSINI Challenges 2024. The annual competition aims to promote the use of space technologies to address pressing commercial, social and environmental challenges.'),
	(73, NULL, 'Today, the EU Agency for the Space Programme (EUSPA) together with the European Commission, announced the winners of the CASSINI Challenges final ‚Äòsubmission of a product‚Äô track. The announcement was made during the CASSINI Entrepreneurship Day in Prague, an annual event that brings together Europe‚Äôs most promising space start-ups and leading investors.¬†'),
	(74, NULL, 'The latest batch of Galileo satellites is now being operated by EUSPA and the Galileo Service Operator for the Early Orbit Phase (EOP).'),
	(75, NULL, 'Stemming from the EU Space Strategy for Security and Defence and facilitated by the European Commission and the EU Agency for the Space Programme (EUSPA), the EU Space ISAC is a collaborative initiative for EU space sector companies to foster exchanges, raise awareness and share best practices to strengthen their security.'),
	(1874, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2025/03/05/GettyImages-2202813786-scaled.jpg', 'The euro surged against the dollar in early trading on Wednesday.'),
	(76, NULL, 'In addition to extending the benefits of the current Safey of Life Service to maritime users, the new EGNOS Safety of Life assisted Service for Maritime users (ESMAS) delivers a dedicated channel for broadcasting maritime safety information like navigational warnings and other urgent safety related messages to ships.'),
	(77, NULL, 'With end-users always at the centre of its action, the EU Space Programme continues to evolve, offering services that contribute to the safety and well-being of European citizens. One such service is the upcoming Galileo Emergency Warning Satellite Service (EWSS).'),
	(78, NULL, 'The report analyses evolving GNSS and EO markets, detailing how global trends and drivers shape the adoption of space-enabled applications. Utilizing the latest data and advanced forecasting models, the report estimates market evolution, including revenues for EO and GNSS, shipments, and the GNSS installed base, up to 2033.'),
	(79, NULL, 'The EU Agency for the Space Programme (EUSPA) annual Open Days event are on Friday 1 and Saturday 2 December 2023 at EUSPA headquarters in Prague, Czech Republic. V p√°tek 1. a v sobotu 2. prosince 2023 se v s√≠dle Agentury Evropsk√© unie pro Kosmick√Ω program (EUSPA) v Praze konaj√≠ ka≈ædoroƒçn√≠ Dny otev≈ôen√Ωch dve≈ô√≠.'),
