	(1882, 'https://static.euronews.com/articles/stories/09/09/64/54/1200x675_cmsv2_1e2d73e9-7695-5c0c-9491-ebb66eacd3c6-9096454.jpg', 'US President Donald Trump is exempting the automakers from 25% tariffs for one month after negotiating with major industrial leaders. Auto stocks rose following the news.'),
	(1883, 'https://static.euronews.com/articles/stories/09/09/64/82/1200x675_cmsv2_f5f53793-4ccb-5acc-9ed0-dec9ee4b069d-9096482.jpg', 'Despite Brexit, the UK government has given up on a return to the imperial system of measurement. Now, a new safeguard tabled by the Liberal Democrats and backed by the Labour government will ensure pints shall stay pints.'),
	(1884, 'https://static.euronews.com/articles/stories/08/67/91/02/1200x675_cmsv2_545118b7-d913-540c-9264-401e0e1b6a99-8679102.jpg', 'Ahead of the Extraordinary European Council meeting in Brussels, Glucksman urges EU leaders not to rely on the US anymore and to invest time and resources in common borrowing. #RadioSchuman'),
	(1885, 'https://static.euronews.com/articles/stories/09/09/43/18/1200x675_cmsv2_06516659-ef3c-5bef-82e4-ff811976483a-9094318.jpg', 'So far the EU Commission hasn\'t published an explanation on how exactly it calculates a platform‚Äôs user numbers under the Digital Services Act.'),
