	(1887, 'https://static.euronews.com/articles/stories/09/09/49/94/1200x675_cmsv2_55258646-e7f7-5ccd-b53e-608871c2ff0e-9094994.jpg', 'Euronews Culture sits down with Norwegian director Emilie Blichfeldt to talk about her savage and thought-provoking reframing of the Cinderella story, which wowed audiences in Sundance and Berlin.\n‚ÄúMost of us end up like the stepsisters - cutting off our toes to try to fit the shoe!‚Äù'),
	(1888, 'https://static.euronews.com/articles/stories/09/09/63/76/1200x675_cmsv2_ccf886eb-46c5-585f-9d76-4f66940719eb-9096376.jpg', 'The White House confirmed Trump had dispatched an envoy for unprecedented direct talks with Hamas over the remaining hostages held in the Gaza Strip.'),
