	(1891, 'https://static.euronews.com/articles/stories/09/09/63/10/1200x675_cmsv2_634f8d7d-003d-5c5c-a172-2ec480950d21-9096310.jpg', 'Novo Nordisk announced launching a direct-to-patient online pharmacy NovoCare, offering a more than half-price cut for its weight-loss treatment Wegovy.'),
	(1892, 'https://static.euronews.com/articles/stories/09/09/48/38/1200x675_cmsv2_10c7bbb3-1d52-54d2-82eb-b311fd0e125c-9094838.jpg', 'Thursday\'s special summit was convened in reaction to Donald Trump\'s unilateral decision to launch negotiations with Vladimir Putin. #EuropeNews'),
	(1893, 'https://static.euronews.com/articles/library/11/04/11/806/14/1114d10d0dd0448e1199cee664b4c2e3bc80651b1450/1200x675_cmsv2_fb730056-1fd9-5a0d-a40f-c65e47355e1e-1114d10d0dd0448e1199cee664b4c2e3bc80651b1450.jpg', 'Video. Catch up with the most important stories from around Europe and beyond - latest news, breaking news, World, Business, Entertainment, Politics, Culture, Travel.'),
	(1894, 'https://static.euronews.com/articles/stories/09/09/38/76/1200x675_cmsv2_b9544410-3b23-5527-bef2-ae87cec9fa5e-9093876.jpg', 'The Minister of Tourism, who was at the ITB international tourism exhibition in Berlin, explains that all the necessary precautionary measures are being taken for the island\'s residents and visitors.'),
	(1895, 'https://static.euronews.com/articles/stories/09/09/44/38/1200x675_cmsv2_7149e3af-e73a-59e6-a951-f2048ca189b0-9094438.jpg', 'The uptick is expected to be driven largely by population growth and ageing, with developing countries seeing the greatest increases in cases.'),
