	(1906, 'https://static.dw.com/image/70914600_6.jpg', '"Whatever it takes" appears to be the motto of the Christian Democrats and Social Democrats, who are expected to form Germany\'s new government. They are set to reform borrowing limits to allow for more military spending.'),
	(1907, 'https://www.europol.europa.eu/sites/default/files/images/lead_image_2.jpg', 'The European Union (EU) and Brazil have signed an agreement that strengthens the partnership between Europol and Brazilian law enforcement, enabling the exchange of operational information.'),
	(1908, 'https://ec.europa.eu/eurostat/documents/2995521/18500196/Drazen_AdobeStock_569649197_RV.jpg', 'Overview In January 2025, compared with December 2024, the seasonally adjusted retail trade volume decreased by 0.3% in the euro area and by 0.2% in the EU, according to first estimates from Eurostat, the statistical office of the European Union. In December 2024, retail trade volume remained stable in both the euro area and the EU. In January 2025, compared with January 2024, the calendar adjusted retail sales index increased by 1.5% in the euro area and by 1.6% in the EU. Monthly comparison by retail sector and by Member State In the euro area in January 2025, compared with December 2024, the volume of retail trade increased for food, drinks, tobacco by 0.6%, decreased for non-food products (except automotive fuel) by 0.7%, decreased for '),
	(1909, 'https://www.europarl.europa.eu/news/img/meta-facebook.jpg', 'In this press kit, you will find a selection of the European Parliament‚Äôs press releases reflecting MEPs‚Äô recent positions on Ukraine and European defence.'),
	(1910, 'https://ec.europa.eu/eurostat/documents/4187653/15590792/Halfpoint_AdobeStock_177731848.jpeg', 'In 2023, 65.7% of people in the EU aged 16 or above reported needing medical examination or treatment. This share was lower for men (62.1%) than for women (69.1%), resulting in a 7.0 percentage points (pp) gap. The share of people in need of medical examination or treatment increased with age. Among individuals aged 16 to 44, 55.8% reported needing medical attention. This percentage rose to 66.7% for those aged 45 to 64 and reached 80.4% among people aged 65 or over.  Notably, the gender gap decreased with age. In the youngest group, the difference between men and women was 8.3 pp. It narrowed to 6.0 pp for those aged 45 to 64 and further reduced to 2.1 pp for those aged 65 or over. Source dataset: hlth_silc_08c'),
	(1911, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2025/03/06/GettyImages-2189859581-scaled.jpg', 'Debt-laden water supplier has secured a private emergency loan ‚Äî but can‚Äôt use it because of ongoing legal action.'),
